INSERT INTO `qrcodedb` (`id`, `title`, `major`, `content`, `image`, `videos`, `address`) VALUES (1, 'first', 'doing', '![image](https://uicdn.toast.com/toastui/img/tui-editor-bi.png)\r\n\r\n# Awesome Editor!\r\n\r\nIt has been _released as opensource in 2018_ and has ~~continually~~ evolved to **receive 10k GitHub ⭐️ Stars**.\r\n\r\n## Create Instance\r\n\r\nYou can create an instance with the following code and use `getHtml()` and `getMarkdown()` of the [Editor](https://github.com/nhn/tui.editor).\r\n\r\n```js\r\nconst editor = new Editor(options);\r\n```\r\n\r\n> See the table below for default options\r\n> > More API information can be found in the document\r\n\r\n| name | type | description |\r\n| --- | --- | --- |\r\n| el | `HTMLElement` | container element |\r\n\r\n## Features\r\n\r\n* CommonMark + GFM Specifications\r\n   * Live Preview\r\n   * Scroll Sync\r\n   * Auto Indent\r\n   * Syntax Highlight\r\n        1. Markdown\r\n        2. Preview\r\n\r\n## Support Wrappers\r\n\r\n> * Wrappers\r\n>    1. [x] React\r\n>    2. [x] Vue\r\n>    3. [ ] Ember', 'https://images.pexels.com/photos/2982889/pexels-photo-2982889.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=150', 'https://images.pexels.com/photos/2982889/pexels-photo-2982889.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=150', 'https://images.pexels.com/photos/2982889/pexels-photo-2982889.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=150');
INSERT INTO `qrcodedb` (`id`, `title`, `major`, `content`, `image`, `videos`, `address`) VALUES (2, 'second', 'finish', '![image](https://uicdn.toast.com/toastui/img/tui-editor-bi.png)\r\n\r\n# Awesome Editor!\r\n\r\nIt has been _released as opensource in 2018_ and has ~~continually~~ evolved to **receive 10k GitHub ⭐️ Stars**.\r\n\r\n## Create Instance\r\n\r\nYou can create an instance with the following code and use `getHtml()` and `getMarkdown()` of the [Editor](https://github.com/nhn/tui.editor).\r\n\r\n```js\r\nconst editor = new Editor(options);\r\n```\r\n\r\n> See the table below for default options\r\n> > More API information can be found in the document\r\n\r\n| name | type | description |\r\n| --- | --- | --- |\r\n| el | `HTMLElement` | container element |\r\n\r\n## Features\r\n\r\n* CommonMark + GFM Specifications\r\n   * Live Preview\r\n   * Scroll Sync\r\n   * Auto Indent\r\n   * Syntax Highlight\r\n        1. Markdown\r\n        2. Preview\r\n\r\n## Support Wrappers\r\n\r\n> * Wrappers\r\n>    1. [x] React\r\n>    2. [x] Vue\r\n>    3. [ ] Ember', 'https://images.pexels.com/photos/2982889/pexels-photo-2982889.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=150', 'https://images.pexels.com/photos/2982889/pexels-photo-2982889.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=150', 'https://images.pexels.com/photos/2982889/pexels-photo-2982889.jpeg?auto=compress&cs=tinysrgb&dpr=1&w=150');
